import { Button } from 'bootstrap';
import './css/Casos.css';
import imagen6 from '../../Assets/imagen6.png';
import imagen7 from '../../Assets/imagen7.jpg';

function Casos(){
    return(
        <div class="container text-center my-5">
  <h2>Restaurantes que Crecen con <span class="highlight-text">InnoVenta</span></h2>

  <div class="row my-5">
    
    <div class="col-md-6 mb-4">
      <div class="circle-image-1 mx-auto"></div>
      <h5>Parrilla La Tradición</h5>
      <p><span class="highlight-text">20%</span> de Reducción en Pérdidas de Inventario</p>
      <p>Calificación de <span class="highlight-text">4.8/5</span> en Reseñas</p>
      <a href="#" class="text-primary">Ver Historia Completa</a>
    </div>

    
    <div class="col-md-6 mb-4">
      <div class="circle-image-2 mx-auto"></div>
      <h5>Restaurante La Playa, Cancún, México</h5>
      <p>Reducción del <span class="highlight-text">20%</span> en tiempos de espera</p>
      <p>Incremento de ventas en un <span class="highlight-text">30%</span></p>
      <a href="#" class="text-primary">Ver Historia Completa</a>
    </div>
  </div>

  <p>¿Quieres que tu restaurante sea nuestro próximo caso de éxito?</p>
  <a href="#" class="cta-button">Obtén Membresía</a>
</div>
    )
}

export default Casos;
